import Link from 'next/link';

const HomePage = () => {
    return (
        <div>
            <Link href='/'>Home</Link>
            <h2 href='/about'><a>About Us!</a></h2>
            <h2>I am Home!</h2>
        </div>
    );
}

export default HomePage;
